        `}],faqs:[{id:1,question:"Скільки коштує будівельна експертиза?",answer:"Вартість будівельної експертизи залежить від складності об'єкта та обсягу робіт. Для отримання точної інформації, зв'яжіться з нашими спеціалістами."},{id:2,question:"Скільки часу займає проведення будівельної експертизи?",answer:"Термін проведення експертизи зазвичай складає від 5 до 14 робочих днів, залежно від складності та обсягу робіт."}]},"zemelno-tekhnichna-ekspertyza":{title:"Земельно-технічна експертиза",description:"Земельно-технічна експертиза необхідна при вирішенні земельних спорів, пов'язаних з розділом земельної ділянки, визначенням порядку користування земельною ділянкою, встановленням її місцезнаходження і меж, накладенням меж ділянок одна на одну, помилками в розрахунку площі та ін.",backgroundImage:"zemelnotehnichna.jpg",categories:["Земельні питання","Нерухомість"],content:`
